This video is made in collaboration with About Us.
About Us is a musical band from Nagaland, India experimenting all class of rock. They have also signed a multi-record deal with an Italian based record label 'Frontiers Music Srl' from Italy. Just recently they have released their 2nd album titled, Take a Piece with 10 songs which is available on all streaming platforms. 
